(15, 'Chính thức: Thuế VAT giảm từ 10% xuống 8% trong năm 2022', 'Chinh thuc: Thue VAT giam tu 10% xuong 8% trong nam 2022', 'Tổng bí thư Nguyễn Phú Trọng trao đổi về các định hướng lớn nhằm đẩy mạnh quan hệ song phương khi hội đàm với Chủ tịch đảng Nước Nga Thống nhất Medvedev', '<h1>Tổng b&iacute; thư Nguyễn Ph&uacute; Trọng hội đ&agrave;m với &ocirc;ng Medvedev</h1>\r\n\r\n<p>Tổng b&iacute; thư Nguyễn Ph&uacute; Trọng trao đổi về c&aacute;c định hướng lớn nhằm đẩy mạnh quan hệ song phương khi hội đ&agrave;m với Chủ tịch đảng Nước Nga Thống nhất Medvedev.</p>\r\n\r\n<p>Trong cuộc hội đ&agrave;m tại trụ sở Trung ương Đảng chiều 22/5, Tổng b&iacute; thư Nguyễn Ph&uacute; Trọng ch&agrave;o mừng Chủ tịch đảng Nước Nga Thống nhất Dmitry Medvedev thăm ch&iacute;nh thức Việt Nam, nhấn mạnh đ&acirc;y l&agrave; chuyến thăm Việt Nam đầu ti&ecirc;n của &ocirc;ng Medvedev tr&ecirc;n cương vị Chủ tịch đảng cầm quyền của Nga.</p>\r\n\r\n<p>Hai l&atilde;nh đạo trao đổi đ&aacute;nh gi&aacute; của mỗi b&ecirc;n về t&igrave;nh h&igrave;nh quốc tế hiện nay, cũng như quan điểm về những vấn đề hai b&ecirc;n c&ugrave;ng quan t&acirc;m, theo th&ocirc;ng c&aacute;o của Ban Đối ngoại Trung ương Đảng.</p>\r\n\r\n<p>Tổng b&iacute; thư Nguyễn Ph&uacute; Trọng v&agrave; &ocirc;ng Medvedev cũng thảo luận về c&aacute;c định hướng lớn nhằm th&uacute;c đẩy mạnh quan hệ giữa hai Đảng, hai nước như tăng cường c&aacute;c chuyến thăm, trao đổi cấp cao, tăng hợp t&aacute;c kinh tế, khoa học, kỹ thuật, văn h&oacute;a, gi&aacute;o dục v&agrave; c&aacute;c lĩnh vực kh&aacute;c.</p>\r\n\r\n<p>Hai b&ecirc;n cũng sẽ ph&aacute;t huy c&aacute;c cơ chế, khu&ocirc;n khổ hợp t&aacute;c thương mại, đầu tư song phương v&agrave; đa phương, tăng cường trao đổi th&ocirc;ng tin về t&igrave;nh h&igrave;nh quốc tế, hợp t&aacute;c giữa cơ quan đối ngoại của hai nước, phối hợp tại c&aacute;c diễn đ&agrave;n quốc tế.</p>\r\n\r\n<p><img alt=\"Tổng bí thư Nguyễn Phú Trọng tiếp Chủ tịch đảng Nước Nga Thống nhất Medvedev tại Hà Nội hôm nay. Ảnh: TTXVN\" src=\"https://i1-vnexpress.vnecdn.net/2023/05/22/tbt-med-3854-1684751573.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=rfK6tOdU0udNhn3yMsQUqw\" /></p>\r\n\r\n<p>Tổng b&iacute; thư Nguyễn Ph&uacute; Trọng tiếp Chủ tịch đảng Nước Nga Thống nhất Medvedev tại trụ sở Trung ương Đảng h&ocirc;m nay. Ảnh:&nbsp;<em>TTXVN</em></p>\r\n\r\n<p>&Ocirc;ng Medvedev b&agrave;y tỏ vui mừng thăm lại Việt Nam, ch&uacute;c mừng sự ph&aacute;t triển năng động của Việt Nam, nhất tr&iacute; với c&aacute;c &yacute; kiến, đ&aacute;nh gi&aacute; của Tổng b&iacute; thư Nguyễn Ph&uacute; Trọng, nhất l&agrave; về phương hướng, biện ph&aacute;p lớn nhằm th&uacute;c đẩy quan hệ giữa hai đảng, hai nước thời gian tới.</p>\r\n\r\n<p>Tổng b&iacute; thư Nguyễn Ph&uacute; Trọng nhấn mạnh Việt Nam lu&ocirc;n tr&acirc;n trọng sự ủng hộ, gi&uacute;p đỡ qu&yacute; b&aacute;u của nh&acirc;n d&acirc;n Li&ecirc;n X&ocirc; v&agrave; nh&acirc;n d&acirc;n Nga anh em, coi trọng quan hệ hữu nghị truyền thống, Đối t&aacute;c chiến lược to&agrave;n diện với Nga. Đảng Cộng sản Việt Nam cũng coi trọng ph&aacute;t triển quan hệ với c&aacute;c ch&iacute;nh đảng ở Nga, trong đ&oacute; c&oacute; đảng Nước Nga Thống nhất, l&agrave;m nền tảng ch&iacute;nh trị cho quan hệ l&acirc;u d&agrave;i v&agrave; bền vững giữa hai nước.</p>\r\n\r\n<p>&Ocirc;ng Medvedev thăm ch&iacute;nh thức Việt Nam ng&agrave;y 21-23/5 theo Thỏa thuận hợp t&aacute;c giữa Đảng Cộng sản Việt Nam v&agrave; đảng Nước Nga Thống nhất.</p>\r\n\r\n<p>Trước hội đ&agrave;m, đo&agrave;n đại biểu đảng Nước Nga Thống nhất đ&atilde; đặt v&ograve;ng hoa tại Đ&agrave;i tưởng niệm c&aacute;c Anh h&ugrave;ng liệt sĩ, v&agrave;o Lăng viếng Chủ tịch Hồ Ch&iacute; Minh v&agrave; c&oacute; cuộc gặp với Hội Hữu nghị Việt Nam - Li&ecirc;n bang Nga.</p>\r\n\r\n<p>Hai b&ecirc;n đ&atilde; ra tuy&ecirc;n bố chung về kết quả chuyến thăm ch&iacute;nh thức Việt Nam của Chủ tịch đảng Nước Nga Thống nhất Medvedev với mục ti&ecirc;u tăng cường hợp t&aacute;c tr&ecirc;n c&aacute;c vấn đề khu vực v&agrave; quốc tế nhằm củng cố h&ograve;a b&igrave;nh, an ninh, v&igrave; lợi &iacute;ch của nh&acirc;n d&acirc;n hai nước, bảo vệ v&agrave; tăng cường c&aacute;c nguy&ecirc;n tắc của luật ph&aacute;p quốc tế, Hiến chương Li&ecirc;n Hợp Quốc, tiếp tục th&uacute;c đẩy quan hệ song phương tr&ecirc;n tinh thần c&aacute;c văn kiện, thỏa thuận đ&atilde; k&yacute; giữa l&atilde;nh đạo cấp cao hai Đảng v&agrave; hai nước.</p>\r\n\r\n<p>Theo số liệu của Bộ Kế hoạch v&agrave; Đầu tư, t&iacute;nh đến cuối năm 2022, Nga c&oacute; 164 dự &aacute;n đầu tư v&agrave;o Việt Nam với tổng mức đầu tư 965,8 triệu USD, đứng thứ 27 trong tổng số 140 quốc gia v&agrave; v&ugrave;ng l&atilde;nh thổ c&oacute; đầu tư trực tiếp v&agrave;o Việt Nam. Việt Nam đầu tư sang Nga 5 dự &aacute;n với tổng mức đầu tư l&agrave; 528 triệu USD trong lĩnh vực c&ocirc;ng nghiệp v&agrave; chế biến, chế tạo.</p>', '1684759075.jpg', 1, NULL, NULL, NULL, b'1', NULL, 'Thời sự', NULL, '2023-05-22 12:37:55', '2023-05-22 12:37:55'),
(16, '9 người Việt tử vong trong vụ xe rơi khỏi vách đá ở Trung Quốc', '9 nguoi Viet tu vong trong vu xe roi khoi vach da o Trung Quoc', 'Chính quyền thành phố Tịnh Tây cho hay 9 người Việt thiệt mạng trong vụ ôtô 7 chỗ lao xuống vách đá ở khu vực gần biên giới với Việt Nam.', '<h1>9 người Việt tử vong trong vụ xe rơi khỏi v&aacute;ch đ&aacute; ở Trung Quốc</h1>\r\n\r\n<p>Ch&iacute;nh quyền th&agrave;nh phố Tịnh T&acirc;y cho hay 9 người Việt thiệt mạng trong vụ &ocirc;t&ocirc; 7 chỗ lao xuống v&aacute;ch đ&aacute; ở khu vực gần bi&ecirc;n giới với Việt Nam.</p>\r\n\r\n<p>Ch&iacute;nh quyền th&agrave;nh phố Tịnh T&acirc;y, tỉnh Quảng T&acirc;y, ng&agrave;y 19/5 cho biết 11 người đ&atilde; thiệt mạng trong vụ &ocirc;t&ocirc; rơi khỏi v&aacute;ch đ&aacute; v&agrave; lao xuống hồ nước b&ecirc;n dưới tại khu vực đồi n&uacute;i ở l&agrave;ng Tứ Minh, trong đ&oacute; c&oacute; 9 người mang giấy tờ t&ugrave;y th&acirc;n Việt Nam.</p>\r\n\r\n<p>Hai nạn nh&acirc;n thiệt mạng c&ograve;n lại gồm một người mang quốc tịch Trung Quốc v&agrave; một người đang được x&aacute;c minh nh&acirc;n th&acirc;n.</p>\r\n\r\n<p><img alt=\"Chiếc xe được cẩu lên khỏi hồ nước tại hiện trường vụ tai nạn. Ảnh: ChinaNews\" src=\"https://i1-vnexpress.vnecdn.net/2023/05/20/texas-shooting-11-1684575575-1913-1684575635.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=GESgH0Zkh3CQ5alV_TcNqw\" /></p>\r\n\r\n<p><iframe frameborder=\"0\" height=\"1\" id=\"google_ads_iframe_/27973503/Vnexpress/Desktop/Inimage/Thegioi/Thegioi.nguoiviet5chau.detail_0\" name=\"google_ads_iframe_/27973503/Vnexpress/Desktop/Inimage/Thegioi/Thegioi.nguoiviet5chau.detail_0\" sandbox=\"\" scrolling=\"no\" tabindex=\"0\" title=\"3rd party ad content\" width=\"1\"></iframe></p>\r\n\r\n<p>Chiếc xe được cẩu l&ecirc;n khỏi hồ nước tại hiện trường vụ tai nạn. Ảnh:&nbsp;<em>ChinaNews</em></p>\r\n\r\n<p>Ba người sống s&oacute;t gồm t&agrave;i xế người Trung Quốc l&agrave;m nhiệm vụ đưa đ&oacute;n v&agrave; hai c&ocirc;ng d&acirc;n Việt Nam. Ch&iacute;nh quyền địa phương cho hay đ&atilde; th&ocirc;ng b&aacute;o sự việc với tổng l&atilde;nh sự qu&aacute;n Việt Nam ở Nam Ninh.</p>\r\n\r\n<p>Giới chức Trung Quốc đang điều tra ba người sống s&oacute;t, do nghi ngờ sự việc li&ecirc;n quan đến hoạt động bu&ocirc;n người ở khu vực bi&ecirc;n giới.</p>\r\n\r\n<p>Trả lời&nbsp;<em>VnExpress</em>, Bộ Ngoại giao ng&agrave;y 20/5 cho biết cơ quan ngoại giao Việt Nam tại Nam Ninh đ&atilde; li&ecirc;n hệ với giới chức sở tại để x&aacute;c minh th&ocirc;ng tin v&agrave; triển khai c&aacute;c biện ph&aacute;p l&atilde;nh sự cần thiết, y&ecirc;u cầu ph&iacute;a Trung Quốc bảo đảm quyền v&agrave; lợi &iacute;ch hợp ph&aacute;p nếu x&aacute;c định đ&acirc;y l&agrave; c&aacute;c c&ocirc;ng d&acirc;n Việt Nam.</p>\r\n\r\n<p>Vụ tai nạn xảy ra s&aacute;ng 19/5 tại tuyến đường qua l&agrave;ng Tứ Minh, th&agrave;nh phố Tịnh T&acirc;y, c&aacute;ch bi&ecirc;n giới khoảng 5-6 km, khi chiếc xe Toyota Highlander lao khỏi v&aacute;ch đ&aacute; tr&ecirc;n con đường n&uacute;i. Đ&acirc;y l&agrave; xe 7 chỗ nhưng chở gấp đ&ocirc;i số người được ph&eacute;p.</p>\r\n\r\n<p><img alt=\"Vị trí xảy ra tai nạn (dấu đỏ) gần biên giới Việt Nam - Trung Quốc. Ảnh: Google Map\" src=\"https://i1-vnexpress.vnecdn.net/2023/05/20/cats-5426-1684554504.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=1QzArz9yQ7R_n30n5dypKg\" /></p>\r\n\r\n<p>Vị tr&iacute; l&agrave;ng Tứ Minh (dấu đỏ) gần bi&ecirc;n giới Việt Nam - Trung Quốc. Ảnh:<em>&nbsp;Google Map</em></p>\r\n\r\n<p>Cơ quan ứng ph&oacute; t&igrave;nh trạng khẩn cấp Tịnh T&acirc;y cho hay địa điểm phương tiện rơi xuống kh&ocirc;ng phải hồ tự nhi&ecirc;n, m&agrave; l&agrave; nơi chứa nước thải của một mỏ than gần đ&oacute;.</p>\r\n\r\n<p>Bộ Ngoại giao Việt Nam đang phối hợp với c&aacute;c cơ quan chức năng trong nước để x&aacute;c minh nh&acirc;n th&acirc;n c&aacute;c nạn nh&acirc;n, hỗ trợ gia đ&igrave;nh họ xử l&yacute; vấn đề hậu sự.</p>', '1684759144.jpg', 1, NULL, NULL, NULL, b'1', NULL, 'Thời sự', NULL, '2023-05-22 12:39:04', '2023-05-22 12:39:04'),
(17, 'Nga khẳng định kiểm soát hoàn toàn Bakhmut', 'Nga khang dinh kiem soat hoan toan Bakhmut', 'Bộ Quốc phòng Nga xác nhận tuyên bố của trùm Wagner rằng họ đã kiểm soát hoàn toàn thành phố Bakhmut ở Donbass.', '<h1>Nga khẳng định kiểm so&aacute;t ho&agrave;n to&agrave;n Bakhmut</h1>\r\n\r\n<p>Bộ Quốc ph&ograve;ng Nga x&aacute;c nhận tuy&ecirc;n bố của tr&ugrave;m Wagner rằng họ đ&atilde; kiểm so&aacute;t ho&agrave;n to&agrave;n th&agrave;nh phố Bakhmut ở Donbass.</p>\r\n\r\n<p>&quot;Ở hướng t&aacute;c chiến Bakhmut, c&aacute;c nh&oacute;m xung k&iacute;ch của c&ocirc;ng ty an ninh tư nh&acirc;n Wagner với sự hỗ trợ của ph&aacute;o binh v&agrave; kh&ocirc;ng qu&acirc;n đ&atilde; ho&agrave;n th&agrave;nh giải ph&oacute;ng Bakhmut&quot;, Bộ Quốc ph&ograve;ng Nga th&ocirc;ng b&aacute;o ng&agrave;y 21/5.</p>\r\n\r\n<p>&quot;Tổng thống Vladimir Putin ch&uacute;c mừng c&aacute;c nh&oacute;m tấn c&ocirc;ng của Wagner cũng như tất cả qu&acirc;n nh&acirc;n thuộc lực lượng vũ trang Nga, những người đ&atilde; cung cấp hỗ trợ cần thiết v&agrave; yểm trợ cho Wagner&quot;, Điện Kremlin ra tuy&ecirc;n bố.</p>\r\n\r\n<p><img alt=\"Thành viên lực lượng Wagner giương cao cờ Nga và cờ Wagner trên một tòa nhà đổ nát không rõ địa điểm trong đoạn video công bố ngày 20/5. Ảnh: Reuters\" src=\"https://i1-vnexpress.vnecdn.net/2023/05/21/2023-05-20T203651Z-1237093502-4435-5471-1684626038.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=hlHriUCA5MubhYHSbvupDg\" /></p>\r\n\r\n<p><iframe frameborder=\"0\" height=\"1\" id=\"google_ads_iframe_/27973503/Vnexpress/Desktop/Inimage/Thegioi/Thegioi.quansu.detail_0\" name=\"google_ads_iframe_/27973503/Vnexpress/Desktop/Inimage/Thegioi/Thegioi.quansu.detail_0\" sandbox=\"\" scrolling=\"no\" tabindex=\"0\" title=\"3rd party ad content\" width=\"1\"></iframe></p>\r\n\r\n<p>Th&agrave;nh vi&ecirc;n lực lượng Wagner giương cờ Nga v&agrave; cờ Wagner tr&ecirc;n một t&ograve;a nh&agrave; đổ n&aacute;t kh&ocirc;ng r&otilde; địa điểm trong video c&ocirc;ng bố ng&agrave;y 20/5. Ảnh:&nbsp;<em>Reuters</em></p>\r\n\r\n<p>Th&ocirc;ng b&aacute;o của Bộ Quốc ph&ograve;ng Nga được đưa ra khoảng 8 tiếng sau khi l&atilde;nh đạo tập đo&agrave;n qu&acirc;n sự tư nh&acirc;n Wagner Yevgeny Prigozhin ng&agrave;y 20/5 tuy&ecirc;n bố &quot;ch&uacute;ng t&ocirc;i đ&atilde; gi&agrave;nh được to&agrave;n bộ th&agrave;nh phố, kiểm so&aacute;t từng ng&ocirc;i nh&agrave;&quot;. &Ocirc;ng Prigozhin th&ocirc;ng b&aacute;o c&aacute;c đơn vị Wagner sẽ r&uacute;t khỏi Bakhmut từ ng&agrave;y 25/5 v&agrave; trao lại th&agrave;nh phố cho lực lượng ch&iacute;nh quy Nga.</p>\r\n\r\n<p>Kiev đ&atilde; l&ecirc;n tiếng phủ nhận tuy&ecirc;n bố của Prigozhin. Thứ trưởng Quốc ph&ograve;ng Ukraine Ganna Malyar khẳng định lực lượng Ukraine vẫn tiếp tục chiến đấu ở Bakhmut d&ugrave; &quot;t&igrave;nh h&igrave;nh rất kh&oacute; khăn&quot;.</p>\r\n\r\n<p>Mykhailo Podolyak, cố vấn của Tổng thống Zelensky, cho rằng Wagner đưa ra tuy&ecirc;n bố để khiến dư luận bớt ch&uacute; &yacute; đến c&aacute;c hoạt động ngoại giao của &ocirc;ng Zelensky tại hội nghị thượng đỉnh G7 ở Nhật Bản.</p>\r\n\r\n<p><a href=\"https://vnexpress.net/chu-de/ukraine-692\" rel=\"dofollow\">Ukraine</a>&nbsp;chưa phản hồi về tuy&ecirc;n bố mới nhất của Bộ Quốc ph&ograve;ng Nga.</p>\r\n\r\n<p>Trận đ&aacute;nh tại Bakhmut được nhận định l&agrave; dữ dội v&agrave; k&eacute;o d&agrave;i nhất trong xung đột Nga - Ukraine, khi cả hai b&ecirc;n đều dồn lực v&agrave;o th&agrave;nh phố từng c&oacute; 70.000 d&acirc;n thuộc tỉnh Donetsk.</p>\r\n\r\n<p>C&aacute;c quan chức v&agrave; chỉ huy qu&acirc;n đội Ukraine từng khẳng định ph&ograve;ng thủ Bakhmut &quot;rất cần thiết về mặt qu&acirc;n sự&quot;, đồng thời nhận định th&agrave;nh phố thuộc tỉnh Donetsk l&agrave; ch&igrave;a kh&oacute;a k&igrave;m h&atilde;m lực lượng Nga ở v&ugrave;ng Donbass v&agrave; ngăn họ tiến xa hơn về ph&iacute;a t&acirc;y.</p>\r\n\r\n<p>Trong khi đ&oacute;,&nbsp;<a href=\"https://vnexpress.net/chu-de/nga-710\" rel=\"dofollow\">Nga</a>&nbsp;nhận định Bakhmut l&agrave; trung t&acirc;m ph&ograve;ng thủ quan trọng của Ukraine tại v&ugrave;ng Donbass, kiểm so&aacute;t th&agrave;nh phố sẽ cho ph&eacute;p họ tiến c&ocirc;ng s&acirc;u hơn v&agrave;o ph&ograve;ng tuyến của đối phương.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"Vị trí thành phố Bakhmut. Đồ họa: RYV\" src=\"https://i1-vnexpress.vnecdn.net/2023/05/21/5563187178137267543a-Nga-Ukrai-7834-5046-1684626039.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=L24MX7y1cbEOImHIFRIsGg\" /></p>\r\n\r\n<p>Vị tr&iacute; th&agrave;nh phố Bakhmut. Đồ họa:&nbsp;<em>RYV</em></p>', '1684759214.jpg', 1, NULL, NULL, NULL, b'1', NULL, 'Thời sự', NULL, '2023-05-22 12:40:14', '2023-05-22 12:40:14');

