(12, 3, 'Sofa 3 Cho ONA HIM da den', 'Sofa 3 Chỗ ONA HIM da đen', 'Sofa 3 chỗ ONA HIM da đen với cảm hứng bắt nguồn từ sự lịch lãm của các quý ông hiện đại. Những giao thoa về xúc chạm tinh tế được khơi nguồn khi chạm nhẹ lên bề mặt lớp da phủ cao cấp. Chân gỗ oak cùng đường nét bo tròn và thu nhỏ dần xuống phía dưới, tạo nên một thiết kế tinh xảo mà đầy vững chắc. Với những tỉ lệ hoàn hảo cùng các đường may tỉ mỉ, sofa ONA HIM giúp không gian căn hộ toát lên vẻ sang trọng và đẳng cấp.', NULL, 'Khung lò xo túi mousse, vải', 'D2800 - R960 - C410/700mm', '16845031571.jpg', NULL, '16845039083.jpg,16845040423.jpg,16845040422.jpg', '2023-05-19 06:32:37', NULL, NULL, 'Sản phẩm mới', b'1', -4, 4, '2023-05-23 17:29:45'),
(13, 5, 'Sofa 3 cho Osaka mau 1 vai 29', 'Sofa 3 chỗ Osaka mẫu 1 vải 29', 'Sofa 3 chỗ từ bộ sưu tập Osaka mang nét hiện đại và thơ mộng của Nhật Bản, tạo nên một không gian sống độc đáo đầy sang trọng. Sản phẩm có phần chân bằng inox màu gold chắc chắn, phần nệm được bọc vải và có thể tháo rời được. Sofa 3 chỗ Osaka mẫu 1 vải 29 không chỉ mang đến thiết kế tinh tế, sang trọng mà còn cho người ngồi cảm giác thoải mái, dễ chịu.', NULL, 'Khung gỗ cao su bọc da bò tự nhiên 100%', 'D2710/1670 - R1000 - C840 mm', '16845033791.jpg', NULL, '16845039083.jpg,16845040422.jpg,16845041331.jpg,16845033792.jpg,16845033793.jpg,16845564741.jpg', '2023-05-19 06:36:19', NULL, NULL, 'Normal', b'1', -12, 12, '2023-05-23 17:29:45'),
(14, 4, 'Ban an Peak hien dai mat Ceramic van may', 'Bàn ăn Peak hiện đại mặt Ceramic vân mây', 'Bàn ăn Peak hiện đại với bề mặt Ceramic được nhập khẩu từ Ý. Mặt Ceramic với khả năng chịu nhiệt tốt cùng họa tiết vân mây tinh xảo tạo cảm giác vừa vững chắc, vừa uyển chuyển. Chân bàn được thiết kế theo hình tam giác với các góc cạnh bo tròn hiện đại cùng những đường nét uốn lượn mềm mại. Bàn ăn Peak với tông màu trắng trang nhã mang lại một không gian sang trọng và đẳng cấp.', NULL, 'Chân kim loại sơn - bọc da Esprit L01 tự nhiên cao cấp', 'D2800 - R960 - C410/700mm', '16845039081.jpg', NULL, '16845039081.jpg,16845039082.jpg,16845039083.jpg', '2023-05-19 06:45:08', NULL, NULL, 'Normal', b'1', -4, 4, '2023-05-23 06:33:10'),
(15, 4, 'Ban an Roma 6 cho', 'Bàn ăn Roma 6 chỗ', 'Bàn ăn Roma với sự kết hợp của chân gỗ tần bì và bề mặt sơn trắng được xử lý khéo léo, thiết kế tinh tế là tâm điểm nổi bật cho phòng ăn hiện đại. Không gian phòng ăn sẽ hoàn hảo hơn khi kết hợp bàn ăn với ghế ăn Roma cùng BST.', NULL, 'Khung gỗ cao su bọc da bò tự nhiên 100%', 'D2100-R850-C830 mm', '16845040421.jpg', NULL, '16845039083.jpg,16845040422.jpg,16845041331.jpg', '2023-05-19 06:47:22', NULL, NULL, 'Sản phẩm mới', b'1', -1, 1, '2023-05-23 06:31:00'),
(16, 4, 'Sofa limited dura goc phai + goi da beige', 'Sofa limited dura góc phải + gối da beige', 'null', NULL, 'Khung lò xo túi mousse, vải', 'D2900/1850- R1000- C600 mm', '16845041331.jpg', NULL, '16845039081.jpg,16845039082.jpg,16845039083.jpg,16845041331.jpg,16845041332.jpg,16845041333.jpg', '2023-05-19 06:48:53', NULL, NULL, 'Normal', b'1', -1, 1, '2023-05-23 06:24:23'),
