(18, 4, 'Ban ben Cave Green 230243Z', 'Bàn bên Cave Green 230243Z', 'Bàn bên Cave Green 230243Z sử dụng chất liệu làm bằng kim loại màu gold kết hợp cùng với kính màu xanh lá, phối hợp cùng bàn nước là điểm nhấn nổi bật cho không gian phòng khách của bạn thêm sang trọng, tinh tế hơn.', NULL, 'Kim loại màu gold -Kính màu xanh', 'Ø440-C560 mm', '16845054541.jpg', NULL, '16845054541.jpg,16845054542.jpg', '2023-05-19 07:10:54', NULL, NULL, 'Normal', b'1', 0, 0, '2023-05-21 03:51:10'),
