(22, 8, 'Ghe an Peak vai cam', 'Ghế ăn Peak vải cam', 'Ghế ăn Peak là tâm điểm nội thất đáng chú ý bởi nó bao phủ xung quanh bằng lớp vải mang sắc cam rực rỡ, nổi bật. Chân ghế sử dụng sắt sơn tĩnh điện màu đen sang trọng được xem là sự kết hợp hoàn hảo của thiết kế nắm bắt xu hướng, sở thích giới trẻ hiện nay.', NULL, 'Bọc Vải Chân sắt sơn tĩnh điện màu đen', 'D470-R490-C800mm', '16845570981.jpg', NULL, '16845570981.jpg,16845570982.jpg', '2023-05-19 21:31:38', NULL, NULL, 'undefined', b'1', 0, 0, '2023-05-21 03:51:10'),
(23, 8, 'Ghe an Peak vai xanh', 'Ghế ăn Peak vải xanh', 'Ghế ăn Peak là tâm điểm nội thất đáng chú ý bởi nó bao phủ xung quanh bằng lớp vải mang sắc xanh dương rực rỡ, nổi bật. Chân ghế sử dụng sắt sơn tĩnh điện màu đen thời thượng được xem là sự kết hợp hoàn hảo của thiết kế nắm bắt xu hướng, sở thích giới trẻ hiện nay.', NULL, 'Bọc Vải Chân sắt sơn tĩnh điện màu đen', 'D470-R490-C800mm', '16845571531.jpg', NULL, '16845571531.jpg,16845571532.jpg', '2023-05-19 21:32:33', NULL, NULL, 'undefined', b'1', 0, 0, '2023-05-21 03:51:10'),
(24, 8, 'Ghe an Rusty 80981K', 'Ghế ăn Rusty 80981K', NULL, NULL, 'chân kim loại sơn - khung mdf bọc da công nghiệp', 'D550 - R540 - C790 mm', '16845572111.jpg', NULL, '16845572111.jpg,16845572112.jpg,16845572113.jpg,16845572114.jpg', '2023-05-19 21:33:31', NULL, NULL, 'undefined', b'1', 0, 0, '2023-05-21 03:51:10'),
(25, 8, 'Ghe an xoay Albert Kuip Taupe 110502Z', 'Ghế ăn xoay Albert Kuip Taupe 110502Z', NULL, NULL, 'Ghế xoay Aluminium, Polyester màu taupe', 'D520-R450-C840 mm', '16845572691.jpg', NULL, '16845572691.jpg,16845572702.jpg,16845572703.jpg,16845572704.jpg', '2023-05-19 21:34:30', NULL, NULL, 'undefined', b'1', 0, 0, '2023-05-21 03:51:10'),
(26, 9, 'Ban ngoai troi YO!', 'Bàn ngoài trời YO!', 'Bàn YO! có chân đế bằng nhôm đã được xử lý và sơn phủ kết hợp mặt laminate để sử dụng ngoài trời. Chúng rất dễ làm sạch và không cần bảo trì trong thời gian dài. Bề mặt laminate đã được thiết kế đặc biệt để ngăn ngừa nấm mốc và nấm mốc phát triển. Yo! cũng có một linh hồn xanh - nó có sẵn một lớp đá Sinh thái được làm từ vật liệu composite tái chế, có thể được tái chế lại khi hết tuổi thọ.', NULL, 'Chân Aluminium sơn màu Lemon yellow mặt bàn HPL Laminate màu cement graphite -Thương hiệu Calligaris Italy', 'Ø900 - C750 mm', '16845576991.jpg', NULL, '16845576991.jpg,16845576992.jpg', '2023-05-19 21:41:39', NULL, NULL, 'undefined', b'1', 0, 0, '2023-05-21 03:51:10'),
(27, 9, 'Ban ben Stulle P98W', 'Bàn bên Stulle P98W', NULL, NULL, 'Chân kim loại sơn, Mặt Melamine', 'Ø400 - C400 mm', '16845577941.jpg', NULL, '16845577941.jpg,16845577942.jpg,16845577943.jpg', '2023-05-19 21:43:14', NULL, NULL, 'undefined', b'1', 0, 0, '2023-05-21 03:51:10'),
(28, 9, 'Ban ngoai troi Easy mau saffron', 'Bàn ngoài trời Easy màu saffron', 'Đồng nghĩa với sự đơn giản, bàn EASY có khung kim loại hình ống và mặt trên bằng kim loại tấm định hình. Tất cả các bộ phận kim loại đã được xử lý và tráng phủ đặc biệt để phù hợp cho việc sử dụng ngoài trời. Bàn có thể xếp chồng cao 4 ngăn.', NULL, 'Kim loại sơn màu Saffron', 'Ø800 - C750 mm', '16845578761.jpg', NULL, '16845578761.jpg,16845578762.jpg', '2023-05-19 21:44:36', NULL, NULL, 'undefined', b'1', 0, 0, '2023-05-21 03:51:10'),
